function getIpInfo(){var e="https://api.ooomn.com/api/ip";fetch(e).then(e=>e.json()).then(e=>{var n=e.country,t=e.ip,r=e.province,o=e.city,i=e.isp;document.getElementById("userAgentIp").innerHTML=t,document.getElementById("userAgentCountry").innerHTML=n,document.getElementById("userAgentRegion").innerHTML=r,document.getElementById("userAgentCity").innerHTML=o,document.getElementById("userAgentIsp").innerHTML=i;var g=navigator.userAgent;document.getElementById("userAgentDevice").innerHTML=g})}getIpInfo();